import { StyleSheet } from "react-native";

export const styles = StyleSheet.create({

    button : {

        flex : .4,
        width : '80%',
        backgroundColor : '#1ed75f',
        borderRadius: 32,
        flexDirection: 'row',
        justifyContent: 'space-around',
        alignItems: 'center',
    },

    text : {

        fontFamily : 'spotifyFont',
        fontSize : 18
    }
})
